import React from "react";

const Helper = ({title, information}) => {
    const handleClick = e => {
        e.preventDefault()
        console.log('helper clicked')
    }

  return (
  <div className="r w100">
      <h1>Helper Title</h1>
      <div>Helper Body Text</div>
      <button className="form-button-p font-white" onClick={handleClick}>
          Ok
      </button>
  </div>
  )
};

export default Helper;
